def prepare_ligand_interaction_1(mol2_file_path, protein_seq):
    # Protein özelliklerini GetProDes ile alıyoruz
    protein_des = Pyprotein.PyProtein(protein_seq).GetALL()

    # Ligandın SMILES formatından RDKit molekül objesi oluşturuluyor
    try:
        m = Chem.MolFromMol2File(mol2_file_path, removeHs=True, sanitize=True)
        if m is None:
            raise ValueError(f"Failed to load molecule from {mol2_file_path}")
    except Exception as e:
        print(f"Error loading molecule: {e}")
        return None

    # MOE (Molecular Operating Environment) hesaplanıyor
    try:
        mol_des = moe.GetMOE(m)
    except Exception as e:
        print(f"Error calculating MOE: {e}")
        return None

    # Ligand-protein etkileşimleri hesaplanıyor
    if mol_des is not None and protein_des is not None:
        mol_mol_interaction1 = PyInteraction.CalculateInteraction1(mol_des, protein_des)
    else:
        print("Error: Could not calculate interaction due to missing descriptors")
        return None

    return mol_mol_interaction1

