def save_chunk_to_csv(data_dict, output_file, interaction_2_keys, inter):
    inter_2_data = pd.DataFrame.from_dict(data_dict, orient='index', columns=interaction_2_keys)
    inter_2_data.columns = [f'inter_{inter}_' + col for col in inter_2_data.columns]
    inter_2_data.index.name = 'protein_pocket'
    inter_2_data.to_csv(output_file, mode='w', header=True)


