    for chunk_idx in range(num_chunks):
        inter_2_out = {}  # Initialize dictionary for current chunk
        chunk = input_list[chunk_idx * chunk_size:(chunk_idx + 1) * chunk_size]

        for i in chunk:
            os.chdir(f"{input_path}/{i}_fixed")
            pockets = glob.glob("*.pdb")
            for poc in pockets:
                sequence_of_pocket = prepare_mathfeature.sequnce_from_PDBParser(f"{input_path}/{i}_fixed/{poc}")
                if len(sequence_of_pocket) <= 10:
                    print(f"Error with {i}_{poc}! The sequence length is not enough.")
