def interaction_1_pre(protein_list, input_file_name, current_dir, delete_files=True):
    output_dir = f"{current_dir}/data/fix_pockets/{input_file_name}"
    files_to_delete = glob.glob(os.path.join(output_dir, "interactions_*_chunk_*.csv"))
    if delete_files:
        for file_path in files_to_delete:
            try:
                os.remove(file_path)
                print(f"Silindi: {file_path}")
            except Exception as e:
                print(f"Silme hatası: {file_path} - {e}")
        # prepare interactions
        get_interaction_1(input_path=f"{current_dir}/data/fix_pockets/{input_file_name}",
                                                                    output_dir=output_dir,
                                                                    mol_path=f"{current_dir}/data/{input_file_name}",
                                                                    input_list=protein_list)
    # Merge all chunks
    interaction_1_csv = glob.glob(os.path.join(output_dir, "interactions_1_chunk_*.csv"))
    all_chunks = [pd.read_csv(f"{output_dir}/interactions_1_chunk_{i + 1}.csv", index_col=0) for i in
                  range(len(interaction_1_csv))]

    final_interactions = pd.concat(all_chunks)
    # final_output_file = f"{output_dir}/final_interactions.csv"
    final_interactions.to_csv("final_interactions.csv")

    #print(f"Final merged file saved as {final_output_file}")
    return final_interactions


